import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class DataHeadertoCardService {
  cityInput : String

  setSharedData(data : String) {
    this.cityInput = data;
  }

  getSharedData() {
    return this.cityInput;
  }

  constructor() { }
}
